// AIServiceServer is the server API for AIService service.
// All implementations must embed UnimplementedAIServiceServer
// for forward compatibility.
//
// AIService provides AI-powered features for memo management.
type AIServiceServer interface {
	// SemanticSearch performs semantic search on memos.
	SemanticSearch(context.Context, *SemanticSearchRequest) (*SemanticSearchResponse, error)
	// SuggestTags suggests tags for memo content.
	SuggestTags(context.Context, *SuggestTagsRequest) (*SuggestTagsResponse, error)
	// Chat streams a chat response with AI agents.
	Chat(*ChatRequest, grpc.ServerStreamingServer[ChatResponse]) error
	// GetRelatedMemos finds memos related to a specific memo.
	GetRelatedMemos(context.Context, *GetRelatedMemosRequest) (*GetRelatedMemosResponse, error)
	// GetParrotSelfCognition returns the metacognitive information of a parrot agent.
	GetParrotSelfCognition(context.Context, *GetParrotSelfCognitionRequest) (*GetParrotSelfCognitionResponse, error)
	// ListParrots returns all available parrot agents with their metacognitive information.
	ListParrots(context.Context, *ListParrotsRequest) (*ListParrotsResponse, error)
	// DetectDuplicates checks for duplicate or related memos.
	DetectDuplicates(context.Context, *DetectDuplicatesRequest) (*DetectDuplicatesResponse, error)
	// MergeMemos merges source memo into target memo.
	MergeMemos(context.Context, *MergeMemosRequest) (*MergeMemosResponse, error)
	// LinkMemos creates a bidirectional relation between two memos.
	LinkMemos(context.Context, *LinkMemosRequest) (*LinkMemosResponse, error)
	// GetKnowledgeGraph returns the knowledge graph for the current user.
	GetKnowledgeGraph(context.Context, *GetKnowledgeGraphRequest) (*GetKnowledgeGraphResponse, error)
	// GetDueReviews returns memos that are due for review.
	GetDueReviews(context.Context, *GetDueReviewsRequest) (*GetDueReviewsResponse, error)
	// RecordReview records a review result and updates spaced repetition state.
	RecordReview(context.Context, *RecordReviewRequest) (*emptypb.Empty, error)
	// GetReviewStats returns review statistics for the current user.
	GetReviewStats(context.Context, *GetReviewStatsRequest) (*GetReviewStatsResponse, error)
	// ListAIConversations returns a list of AI conversations.
	ListAIConversations(context.Context, *ListAIConversationsRequest) (*ListAIConversationsResponse, error)
	// GetAIConversation returns a specific AI conversation with its messages.
	GetAIConversation(context.Context, *GetAIConversationRequest) (*AIConversation, error)
	// CreateAIConversation creates a new AI conversation.
	CreateAIConversation(context.Context, *CreateAIConversationRequest) (*AIConversation, error)
	// UpdateAIConversation updates an AI conversation.
	UpdateAIConversation(context.Context, *UpdateAIConversationRequest) (*AIConversation, error)
	// DeleteAIConversation deletes an AI conversation.
	DeleteAIConversation(context.Context, *DeleteAIConversationRequest) (*emptypb.Empty, error)
	// AddContextSeparator adds a context separator marker to a conversation.
	AddContextSeparator(context.Context, *AddContextSeparatorRequest) (*emptypb.Empty, error)
	// ListMessages returns messages for a conversation with incremental sync support.
	ListMessages(context.Context, *ListMessagesRequest) (*ListMessagesResponse, error)
	// ClearConversationMessages deletes all messages in a conversation.
	ClearConversationMessages(context.Context, *ClearConversationMessagesRequest) (*emptypb.Empty, error)
	// StopChat cancels an ongoing chat stream and terminates the associated session.
	StopChat(context.Context, *StopChatRequest) (*emptypb.Empty, error)
	// GetSessionStats retrieves statistics for a specific session.
	GetSessionStats(context.Context, *GetSessionStatsRequest) (*SessionStats, error)
	// ListSessionStats retrieves session statistics with pagination.
	ListSessionStats(context.Context, *ListSessionStatsRequest) (*ListSessionStatsResponse, error)
	// GetCostStats retrieves aggregated cost statistics for the user.
	GetCostStats(context.Context, *GetCostStatsRequest) (*CostStats, error)
	// GetUserCostSettings retrieves user-specific cost control settings.
	GetUserCostSettings(context.Context, *emptypb.Empty) (*UserCostSettings, error)
	// SetUserCostSettings updates user-specific cost control settings.
	SetUserCostSettings(context.Context, *SetUserCostSettingsRequest) (*UserCostSettings, error)
	// ListBlocks retrieves blocks for a conversation.
	ListBlocks(context.Context, *ListBlocksRequest) (*ListBlocksResponse, error)
	// GetBlock retrieves a specific block.
	GetBlock(context.Context, *GetBlockRequest) (*Block, error)
	// CreateBlock creates a new conversation block.
	CreateBlock(context.Context, *CreateBlockRequest) (*Block, error)
	// UpdateBlock updates a block.
	UpdateBlock(context.Context, *UpdateBlockRequest) (*Block, error)
	// DeleteBlock deletes a block.
	DeleteBlock(context.Context, *DeleteBlockRequest) (*emptypb.Empty, error)
	// AppendUserInput appends a user input to an existing block.
	AppendUserInput(context.Context, *AppendUserInputRequest) (*emptypb.Empty, error)
	// AppendEvent appends an event to the block's event stream.
	AppendEvent(context.Context, *AppendEventRequest) (*emptypb.Empty, error)
	// ForkBlock creates a new block as a branch from an existing block.
	// The new block inherits the parent's conversation and user inputs,
	// allowing the user to regenerate a different AI response.
	ForkBlock(context.Context, *ForkBlockRequest) (*Block, error)
	// ListBlockBranches lists all child blocks of a given block.
	// Returns the tree structure showing all branches from this block.
	ListBlockBranches(context.Context, *ListBlockBranchesRequest) (*ListBlockBranchesResponse, error)
	// SwitchBranch switches the active branch for a conversation.
	// Updates the branch_path to make the specified block the active leaf.
	SwitchBranch(context.Context, *SwitchBranchRequest) (*emptypb.Empty, error)
	// DeleteBranch deletes a block and all its descendants.
	// Used for pruning unwanted conversation branches.
	DeleteBranch(context.Context, *DeleteBranchRequest) (*emptypb.Empty, error)
	mustEmbedUnimplementedAIServiceServer()
}

